import React from "react";
import logo from "./logo.svg";
import "./App.css";
import { Form, Label, Input, Header, Container } from "semantic-ui-react";

function App() {
  return (
    <Container textAlign="center">
      <Header as="h2">Kiefer</Header>
      <Form>
        <Form.Field>
          <Label> email address</Label>
          <Input placeholder="email address" />
        </Form.Field>
        <Form.Field>
          <Label> password</Label>
          <Input placeholder="password" />
        </Form.Field>
      </Form>
    </Container>
  );
}

export default App;
